import React, { useState } from 'react';
import '../../App.css';

function Nav() {
  const [firstButtonClicked, setFirstButtonClicked] = useState(false);
  const [secondButtonClicked, setSecondButtonClicked] = useState(false);

  const handleFirstButtonClick = () => {
    setFirstButtonClicked(true);
  };

  const handleSecondButtonClick = () => {
    setSecondButtonClicked(true);
  };

  return (
    <div>
      <nav id="nav">
        {!firstButtonClicked && (
          <button className="nav_link" id="toggleButton1" onClick={handleFirstButtonClick}>
            Кафедра
          </button>
        )}
        {!secondButtonClicked && (
          <button className="nav_link" id="toggleButton2" onClick={handleSecondButtonClick}>
            Багыттары
          </button>
        )}
        <button className="nav_link">Жанылыктар</button>
        <button className="nav_link">Иш-чаралар</button>
        <button className="nav_link">Байланыш үчүн</button>
      </nav>
      {firstButtonClicked && (
        <div id="hiddenDiv1">
          <div className="container">
            <div className="togged_kafedra">
              <div className="part1">Кафедра</div>
              <div className="part2">
                <ul>
                  <li>
                    <a href="">Тарыхы</a>
                  </li>
                  <li>
                    <a href="">Курамы</a>
                  </li>
                  <li>
                    <a href="">Аккредитация</a>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}

      {secondButtonClicked && (
        <div id="hiddenDiv2">
          <div className="container">
            <div className="togged_bagytary">
              <div className="part1">багыттар жана профилдер</div>
              <div className="part2">
                <ul>
                  <li>
                    <a href="">Графика</a>{' '}
                  </li>
                  <li>
                    <a href="">Информатика жана Эсептөө техникасы</a>
                  </li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Nav;
